description:
【 kỳ ảo yêu cầu viết bài đại tái 】

Mặt ngoài, bạch tiếu chỉ là một cái trừ bỏ xinh đẹp bên ngoài, thập phần bình phàm nữ tử cao trung sinh;

Trên thực tế, bạch tiếu lại là thần quái lừa gạt sư, thế giới chi cải tạo giả, hết thảy phía sau màn độc thủ;

Nàng lớn nhất lạc thú, đó là bịa đặt thần quái hiện tượng, lợi dụng mọi người nhận tri đem nó cụ hiện ra tới;

Sau đó đối ác nhân nhóm nói: Trong vòng 3 ngày cá mập ngươi, liền tro cốt đều cho ngươi dương lạc!

( thư hữu đàn, tiêu tiêu hôm nay cũng tưởng sờ cá: 1063158820 )
